const Articles = () => {

  const articles = [
    {id: 1, name: 'aaa'},
    {id: 2, name: 'bbb'},
    {id: 3, name: 'ccc'},
    {id: 4, name: 'ddd'},
    ];

  return (
    <div>
      {articles.map((article) => {
        <p>{article.name}</p>
      })}
    </div>
  )
};

export default Articles;
